var DemoLayer = cc.Layer.extend({
    init:function () {
        this._super();
        
        this._winSize = cc.Director.getInstance().getWinSize();
        // create title
        var demoTitle = cc.LabelTTF.create("SVG Path Demo", "Impact", 40);
        demoTitle.setPosition(cc.p(this._winSize.width / 2, this._winSize.height - 30));
        this.addChild(demoTitle, 1);
        
        // add svg sprite
        var count = 0;
        var lineCount = 1;
        var spritePerLine = 17;
        var r = 255, g = 255, b = 255;
        for (var name in gSVGIcon) {
        	count ++;
            var svgSprite = SVGSprite.create(gSVGIcon[name]);
            svgSprite.setFlipY(true);
            svgSprite.setScale(1.5);
            svgSprite.setColor(cc.c3b(r, g, b));
            svgSprite.setPosition(cc.p(30 + 60 * ((count - 1) % spritePerLine), 66 * lineCount));
            this.addChild(svgSprite, 99, 1000 + count);
            var svgSpriteName = cc.LabelTTF.create(name, "Impact", 14);
            svgSpriteName.setPosition(cc.p(30 + 60 * ((count - 1) % spritePerLine), 66 * lineCount - 35));
            this.addChild(svgSpriteName, 1, 2000 + count);
            if (count % spritePerLine == 0) {
            	lineCount ++;
            }
        }
        
        // add menu
        cc.MenuItemFont.setFontSize(30);
        cc.MenuItemFont.setFontName("Impact");
        callTigerMenuItem = cc.MenuItemFont.create("CALL TIGER", this.callTiger, this);
        callTigerMenuItem.setColor(cc.RED);
        var menu = cc.Menu.create(callTigerMenuItem);
        menu.setPosition(cc.p(this._winSize.width * 9 / 10, this._winSize.height - 50));
        this.addChild(menu, 999, 999);
        
        return true;
    },
    callTiger:function () {
    	// remove all sprite icon
    	var count = 0;
    	for (var i in gSVGIcon) {
    		count ++;
    		this.removeChildByTag(1000 + count, true);
    		this.removeChildByTag(2000 + count, true);
    	}
    	this.removeChildByTag(999, true);
    	
    	// call tiger
    	this._strokeLabel = cc.LabelTTF.create("", "Impact", 30);
    	this._strokeLabel.setPosition(cc.p(this._winSize.width / 2, this._winSize.height - 80));
        this.addChild(this._strokeLabel);
        
        this.schedule(this.tigerStrokerTimer, 0.1);
        this.stroke = 0;
    },
    tigerStrokerTimer:function (dt) {
    	this.stroke ++;
    	var p = gTiger[this.stroke]['path'];
    	if (!this._tigerSVGSprite) {
    		this._tigerSVGSprite = SVGSprite.create(p);
    		this._tigerSVGSprite.setPosition(cc.p(this._winSize.width / 2 - 100, this._winSize.height / 2 + 100));
    		this._tigerSVGSprite.setIgnoreContentSize(true);
    		this._tigerSVGSprite.setFlipY(true);	
    		this.addChild(this._tigerSVGSprite);
    	}
    	else {
    		this._tigerSVGSprite.appendPath(p);
    	}
    	this._strokeLabel.setString("STROKE: " + this.stroke);
    }
});

var DemoScene = cc.Scene.extend({
    onEnter:function () {
        this._super();
        var layer = new DemoLayer();
        layer.init();
        this.addChild(layer);
    }
});

